import React from 'react';
import defaultImg from '../Utility/defaultImg.jpg'
import GithubImage from '../Utility/GitHub-Mark/GitHub-Mark/PNG/GitHub-Mark-Light-32px.png'
const Footer = () => {
    return (
        <div className='w-screen bg-blue-800 text-white font-bold h-12 flex flex-col p-2'>


            <span>
                Created By Rohan Gupta
                <div>
                    Check out my Github Profile
                </div>
            </span>

            <img className='inline mx-2' src={GithubImage} alt={defaultImg} />
        </div>
    )
}

export default Footer;
